import { Row, Col, Card } from 'react-bootstrap';
import { connect } from 'react-redux';

function Event({event}) {
  return(
    <div class="card my-4">
      <div class="card-header font-weight-bold h4 text-primary">{event.user.name}</div>
      <div class="card-body">
        <h5 class="card-title h1 mr-2 font-weight-bold text-info">{event.name}</h5>
        <h5 class="card-subtitle text-secondary mr-2 my-2">{event.date}</h5>
        <p class="card-text card-text font-weight-bold h4">{event.description}</p>
      </div>
    </div>
  );
}

function Feed({events}) {
  let cards = events.map((event) => (
    <Event event={event} key={event.id} />
  ));
  return (
    <div>
      <h2>Feed</h2>
      <Row>{cards}</Row>
    </div>
  );
}

export default connect(({events}) => ({events}))(Feed);
